function WidgetData(props){
    return (
        <div className="widget widget-chart-one">
            <h3>{props.t1}</h3>
            <h5>{props.t2}</h5>
            <hr/>
            <h3>{props.t3}</h3>
            <h5>{props.t4}</h5>
            <hr/>
            <h3>{props.t5}</h3>
            <h5>{props.t6}</h5>
        </div>
    )
}

export default WidgetData;
